import React from 'react'
import PropTypes from 'prop-types';

export default function Alert(props) {
  return (
    props.alert&&<div class={`alert alert-${props.alert.type} alert-dismissible fade show`} style={{textTransform:'capitalize'}} role="alert">
        <strong>{props.alert.message}</strong><button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
    </div>
  )
}

Alert.defaultProps={
    alerttype:PropTypes.string.isRequired,
}

Alert.propTypes={
    alerttype:'Set Alert here',
}
